$(document).ready(function () {
    if ($('#calendar').length > 0) {
        var
        /*  */
            date = new Date(),
            month,
            year,
            day,
            defaultDate;
        /*   1, ..    0( = 0,  = 1,     = 1  ..)*/
        month = date.getMonth() + 1;
        year = date.getFullYear();
        day = date.getDate();

        defaultDate = year
            + '-'
            + (month < 10 ? '0' + month : month) //   : 01 - , 02 -   ..
            + '-'
            + (day < 10 ? '0' + day : day);
        /* */
        $('#calendar').fullCalendar({
            header: {
                left: 'prev, next today',
                center: 'title',
                right: 'month, basicWeek, basicDay'
            },
            defaultDate: defaultDate,
            lang: omsu_msg.site_lang,
            editable: false,
            eventLimit: false,
            events: function (start, end, timezone, callback) {
                $.ajax({
                    url: window.location['pathname'] + 'index.php',
                    method: 'POST',
                    dataType: 'json',
                    data: {
                        START: start.unix(),
                        END: end.unix()
                    },
                    success: function (doc) {
                        var events = [];
                        $(doc).each(function () {
                            events.push({
                                id: $(this).attr('id'),
                                title: $(this).attr('title'),
                                start: $(this).attr('start'),
                                end: $(this).attr('end'),
                                description: $(this).attr('description'),
                                active_from: $(this).attr('active_from'),
                                active_to: $(this).attr('active_to')
                            });
                        });
                        callback(events);
                    }
                });
            },
            eventRender: function(event, element) {
                element.qtip({
                    content: {
                        title: event.title,
                        text: omsu_msg.event_starts
                        + event.active_from
                        + '<br>'
                        + omsu_msg.event_finish
                        + event.active_to
                        + '<br>'
                        + '<br>'
                        + omsu_msg.about_event
                        + event.description
                    },
                    position: {
                        my: 'top center',
                        at: 'bottom center',
                        target: $(element)
                    },
                    style: { classes: 'myQtip' }
                });
            }
        });
    }

    setTimeout(function(){
        $('.fc-title').each(function(){
            if($(this).height()>45) {
                var text = $(this).text().split(' ');
                var newText = '';
                for(var i=0; i<text.length; i++){
                    var str = '';
                    if(!newText){
                        str = text[i];
                    } else {
                        str = newText + ' ' + text[i];
                    }
                    $(this).text(str+'...');
                    if($(this).height() > 45){
                        var char = newText.substr(newText.length -1, newText.length );
                        if(char == ','){
                            newText = newText.slice(0,-1);
                        }
                        $(this).text(newText +'...');
                        break;
                    } else {
                        newText = str;
                    }
                }
            }
        });
    }, 500);
});
(function($){
    jQuery.fn.omsu_dropdown = function () {
        var toggleCls = function (event, el) {
            switch (event.type) {
                case 'mouseenter':
                    $(el).addClass('open');
                    break;
                case 'mouseleave':
                    $(el).removeClass('open');
                    break;
            }
        };

        $(this).find('li').hover(function (e) {
            if (!!$(this).find('ul').length) {
                toggleCls(e, this);
            }
        })
    };
    jQuery.fn.omsu_header_search = function () {
        var btn = $('.search-bar-toggle', this),
            formPanel = $('.form', this);

        formPanel.hide();
        btn.click(function() {
            formPanel.toggle('fast');
            event.preventDefault();
        });

        $('form', formPanel).submit(function(event) {
            return !!$('input', this).val()
        });
    };
    jQuery.fn.stick_bottom_footer = function () {
        var fixWrapperHeight = function () {
            $('.wrapper').css({
                'minHeight': 'calc(100vh - ' + $('footer').height() + 'px)'
            });
        };
        fixWrapperHeight();
        $(this).resize(function() {
            fixWrapperHeight();
        });
    };
    jQuery.fn.omsu_faq = function () {
        var control = this.find('.control');

        $(this).find('.answer').hide(); // hide all answers
        $(control).text(omsu_msg.show_answer);
        control.click(function (e) {
            answer = $(this).parent().find('.answer');
            if (answer.is(':visible')) {
                $(this).text(omsu_msg.show_answer)
            } else {
                $(this).text(omsu_msg.hide_answer)
            }
            answer.slideToggle('fast');
            e.preventDefault();
        })
    };

    jQuery.fn.omsu_sidebar_search = function() {
        var control = $('.control > a', this),
            form = $('.search-form', this);
        
        control.text(omsu_msg.hide_search);
        control.click(function () {
            if (form.is(':visible')) {
                control.text(omsu_msg.show_search);
            } else {
                control.text(omsu_msg.hide_search);
            }
            form.toggle();
            return false;
        })
    };

    jQuery.fn.omsu_tree = function() {
        $(this).find('li:has(ul)').addClass('parent');

        var parent = $(this).find('li.parent');

        $('li.parent', this).find('.control').on('click', function (e) {
            var children = $(this).closest('li').find(' > ul > li');

            if (children.is(":visible")) {
                children.hide('fast');
            } else {
                children.show('fast');
            }
            return false;
        });
    };

    jQuery.fn.omsu_combobox = function(){
        var el = this,
            queryString,
            mask = this.find('.omsu_combobox_mask'),
            listItems = this.find('li'),
            searchfield = this.find('input');

        searchfield.keyup(function () {
            queryString = this.value;
            doFilter();
        });

        doFilter = function () {
            listItems.each(function (index, el) {
                var expr = new RegExp(queryString, 'gi'),
                    str = $(el).find('a').text();
                (str.match(expr)) ? $(el).show() : $(el).hide()
            })
        };

        mask.click(function () {
            $(this.parentNode).fadeOut();
        });

        return this;
    };
})(jQuery);
